return {
    Add: function () {
        var entity = {
            StatusId: 1,
            TypeId: 1,
            VoucherTypeId: 7,
            InsertedBy: this.Token.UserId,
            ShipmentDate: this.dayjs().format('YYYY-MM-DD')
        }
        this.OpenPopup("air-export-editor", entity);
    },
    Edit: function (btn, entity) {
        this.OpenPopup("air-export-editor", entity);
    },
    EditHbl: function (btn, entity) {
        this.OpenPopup("air-export-editor", { Id: entity.ParentId }, true, { HblEntity: entity });
    }
}

